import numpy as np

def priority_v2(item: float, bins_remain_cap: np.ndarray) -> np.ndarray:
    slack = bins_remain_cap - item
    fits = slack >= 0
    eps = np.finfo(slack.dtype).eps
    return np.where(fits, -slack + eps, -np.inf)

import numpy as np

def priority_v2(item: float, bins_remain_cap: np.ndarray) -> np.ndarray:
    """Priority for Worst-Fit: higher value for bins leaving most empty after packing."""
    return np.where(bins_remain_cap >= item, (bins_remain_cap - item) ** 2, -np.inf)
